INSERT INTO "business_services_locales" ("title", "description", "id", "_locale", "_parent_id", "url_name") VALUES ('Pickup & Tanker Vehicles', 'Well-equipped pickup and tanker vehicles designed for safe and efficient fuel transportation across all regions.', 14, 'en', '0bdbb175-83ad-4719-889e-9921eed2303d', NULL);
INSERT INTO "business_services_locales" ("title", "description", "id", "_locale", "_parent_id", "url_name") VALUES ('تجهيز محطات الوقود والمعدات', 'نقدّم حلولًا متكاملة لتجهيز محطات الوقود، تشمل توفير المعدات، التركيب، والدعم التشغيلي بما يتناسب مع احتياجاتكم.', 15, 'ar', '0bdbb175-83ad-4719-889e-9921eed2303d', NULL);
INSERT INTO "business_services_locales" ("title", "description", "id", "_locale", "_parent_id", "url_name") VALUES ('Exclusive Agent for the British company AZTEC OILS', 'Authorized distributor of Dach AKG lubricants, offering high-quality oils that enhance engine performance and extend equipment lifespan.', 33, 'en', '68943d93-3a14-4f49-818a-cc3af8d3925c', 'AZTEC OILS');
INSERT INTO "business_services_locales" ("title", "description", "id", "_locale", "_parent_id", "url_name") VALUES ('الوكيل الحصري لشركة AZTEC OILS البريطانية', 'موزع معتمد لزيوت داش AKG، نقدم زيوت عالية الجودة تعزز أداء المحركات وتطيل عمر المعدات.', 34, 'ar', '68943d93-3a14-4f49-818a-cc3af8d3925c', 'AZTEC OILS');
INSERT INTO "business_services_locales" ("title", "description", "id", "_locale", "_parent_id", "url_name") VALUES ('Maintenance & Mechanical Services', 'Professional maintenance and mechanical services to keep vehicles and equipment operating at peak performance with minimal downtime.', 35, 'en', '9d731f05-4bcf-4ab2-af47-94386da94c7f', NULL);
INSERT INTO "business_services_locales" ("title", "description", "id", "_locale", "_parent_id", "url_name") VALUES ('توزيع المحروقات', 'نوفّر خدمات توزيع محروقات موثوقة لضمان استمرارية الإمداد للمحطات، الشركات، والأساطيل، مع تركيز عالٍ على السلامة والكفاءة.', 36, 'ar', '9d731f05-4bcf-4ab2-af47-94386da94c7f', NULL);
INSERT INTO "business_services_locales" ("title", "description", "id", "_locale", "_parent_id", "url_name") VALUES ('Fuel Station Setup & Equipment', 'Complete solutions for setting up fuel stations, including equipment supply, installation, and operational support tailored to your needs.', 37, 'en', 'f13d2722-faea-45c1-b8b8-c163991b4438', NULL);
INSERT INTO "business_services_locales" ("title", "description", "id", "_locale", "_parent_id", "url_name") VALUES ('آليات البيك أب والصهاريج', 'أسطول من آليات البيك أب والصهاريج المجهّزة لضمان نقل المحروقات بأمان وكفاءة إلى جميع المناطق.', 38, 'ar', 'f13d2722-faea-45c1-b8b8-c163991b4438', NULL);
INSERT INTO "business_services_locales" ("title", "description", "id", "_locale", "_parent_id", "url_name") VALUES ('Fuel Distribution', 'We provide reliable distribution of fuel to ensure continuous supply for stations, businesses, and fleets, with a strong focus on safety and efficiency', 39, 'en', 'e7ca2927-221c-43eb-8b3c-5f8fd6cc6c17', NULL);
INSERT INTO "business_services_locales" ("title", "description", "id", "_locale", "_parent_id", "url_name") VALUES ('خدمات الصيانة والميكانيك', 'خدمات صيانة وميكانيك احترافية للحفاظ على جاهزية الآليات والمعدات بأعلى مستوى من الأداء وتقليل فترات التوقف.', 40, 'ar', 'e7ca2927-221c-43eb-8b3c-5f8fd6cc6c17', NULL);

